export const addClassificado = (classificados, classificadoToAdd) => {
  const existingClassificado = classificados.find(
    (classificado) => classificado.id === classificadoToAdd.id
  );

  if (existingClassificado) {
    return;
  }

  return [...classificados, classificadoToAdd];
};
